import React from 'react';
import './styles.css';
import {Link} from 'react-router-dom';

function Nav() {
	const navStyle = {
		color: 'white'
	};
	
	return (
		<nav>
			<h1>Logo</h1>
			<ul className="nav-links">
				<Link style={navStyle} to="/about">
					<li>About</li>
				</Link>
				<Link style={navStyle}>
					<li to="/shop">Shop</li>
				</Link>
			</ul>
		</nav>
	);
}

export default Nav;
